SET foreign_key_checks = on;
/*
Use this to create and populate a temporary table, whose id's can be compared
to the set of id's successfully loaded by the UnionPayRates.sql file, to figure
out which Pay_rate entries did NOT load, in case you can't figure it out from 
the XLS.
*/

select * from temp_id t left join pay_rate p on t.id = p.id where p.start_date is null limit 50;
select count(*) from temp_id;

